import React from "react";
import Aux from "./Auxliliary/Auxiliary";
import Emoji from "./Emoji"

const Card = (props) => {
  return (
    <Aux>
      <div className="div1">
        <div className="div2">
          <h1>{props.head1}</h1>
        </div>
        <div className="div3">
          <div className="div4">
            <span>{props.span}</span>
            <p>Hello! The world is beuatiful</p>
          </div>
        </div>
      </div>
    </Aux>
  );
};

export default Card;
